import React, { Component } from 'react';
import { Card, Col, Image, Row } from 'react-bootstrap';
import { Link } from 'react-router-dom';
class Info_user extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (

            <Card className='' style={{maxWidth:'300px'}}> 
                <Row className='flex-row '>

                    <Image style={{maxWidth:'100px'}} roundedCircle  src='https://viblo.asia/images/mm.png'></Image>

                    <Col>
                        <Link className="h2 text-left">{this.props.title}</Link>
                        <Card.Body>{this.props.content}</Card.Body>
                    </Col>
                </Row>
            </Card>
        );
    }
}

export default Info_user;
